  false,\n\t\"url\": null,\n\t\"notes\": \"Milfoil was discovered in McDowell Lake
  in August 2011. Milfoil was treated in the lake using SONAR aquatic herbicide in
  May, June and July 2012. Treatments were made with the assistance of the Washington
  State Department of Fish and Wildlife. In addition Bailey Lake and Potteru2019s
  Pond were surveyed for milfoil. All refuges waters open to boats were either treated
  for milfoil or were surveyed and with no milfoil detected.\",\n\t\"license_title\":
